import React from 'react'

function GenerateReport() {
    return(
        <div>
            <button className="btn btn-primary btn-block">Users</button>
            <button className="btn btn-primary btn-block">Staff</button>
            <button className="btn btn-primary btn-block">Rooms</button>
        </div>
    )
    
}

export default GenerateReport;
